import React from "react";

export default function Header(params) {
  return (
    <header>
      <div>
        <Link to="#" className={styles.link}>
          Login
        </Link>
        <Link to="#" className={styles.link}>
          Register
        </Link>
      </div>
    </header>
  );
}
